import { eventLog } from '@/api/workFlow/FlowBefore'
export default {
  components: {},
  data() {
    return {
      title: '',
      taskNodeId: '',
      listLoading: false,
      list: []
    }
  },
  methods: {
    goBack() {
      this.$emit('close')
    },
    init(id, fullName) {
      this.taskNodeId = id || ''
      this.title = fullName + '审批节点名称'
      this.initData()
    },
    initData() {
      this.listLoading = true
      eventLog(this.taskNodeId).then(res => {
        this.list = res.data.list || []
        this.listLoading = false
      })
    },
  }
}
